import Intro from './components/Intro.js';
import VideoGallery from './components/VideoGallery.js';
import './App.css';
import { Button, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css'

// Main -----------------------------

export default function App() {
  return (
    <>
      <div className="App">
        <Intro />
        <VideoGallery />
      </div>
      <footer>
        Test
      </footer>
    </>
  );
}

